if(event \&\& 
   event.message \&\& 
   event.message.eventInfo \&\& 
   event.message.eventInfo.customUrlContext \&\& 
   event.message.eventInfo.customUrlContext.hasOwnProperty('customURL')) {
      arr = event.message.eventInfo.customUrlContext.customURL.split(".com");
      return arr[arr.length-1];
}
"}
